import React from 'react';
import './styles/App.css';
import Routers from './routes/Routers';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
  useHistory,
  useLocation
} from 'react-router-dom';
function App() {
  return (
    <Router>
      <div className='App'>
        <Routers />
      </div>
    </Router>
  );
}

export default App;
